            function redirectToNewPage() {

						window.location.href = "home.html";

            // JavaScript for showing and hiding pop-ups
            function showPopup(popupId) {
                var popup = document.getElementById(popupId);
                if (popup) {
                    popup.style.display = "block";
        
                    // Add an event listener to close the pop-up when clicking outside of it
                    popup.addEventListener("click", function (e) {
                        if (e.target === popup) {
                            closePopup(popupId);
                        }
                    });
                }
            }
        
            function closePopup(popupId) {
                var popup = document.getElementById(popupId);
                if (popup) {
                    popup.style.display = "none";
                    // Remove the event listener when the pop-up is closed
                    popup.removeEventListener("click", function (e) {
                        if (e.target === popup) {
                            closePopup(popupId);
                        }
                    });
                }
            }
        
            // Add event listeners to your "Log In" and "Sign Up" buttons
            document.querySelector(".button.login").addEventListener("click", function () {
                showPopup("login-popup");
            });
        
            document.querySelector(".button.signup").addEventListener("click", function () {
                showPopup("signup-popup");
            });
        
            document.querySelector(".popl").addEventListener("click", function () {
                closePopup("signup-popup");
                showPopup("login-popup");
            });
        
            document.querySelector(".pops").addEventListener("click", function () {
                closePopup("login-popup");
                showPopup("signup-popup");
            });
        
        </script>
